import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Card } from "react-bootstrap";

const API_URL = "http://localhost:5009/api/company";
const CardObject = ({ objectData, companyId, identifiers }) => {
  const [objectCards, setObjectCards] = useState([]);

  useEffect(() => {
    const fetchObjectCards = async () => {
      try {
        const response = await axios.post(`${API_URL}/getObjCards`, {
          companyId,
          identifiers,
        });
        setObjectCards(response.data);
      } catch (error) {
        console.log('Ошибка при получении карточек объектов:', error);
      }
    };

    fetchObjectCards();
  }, [companyId, identifiers]);
  return (
    <Card border="primary" style={{ margin: 10}}>
      <Card.Body>
        <Card.Header>{objectData.name}</Card.Header>
        <Card.Text>
          <div className="card-text">
            <p>Регистрационный номер: {objectData.registry_number}</p>
            <p>Date Entry: {objectData.date_entry}</p>
            <p>Kind Object: {objectData.kind_object}</p>
            <p>Тип объекта: {objectData.type_object}</p>
            <p>Адрес: {objectData.address}</p>
            <p>Субъект РФ: {objectData.subject_rf}</p>
            <p>Settlement: {objectData.settlement}</p>
            <p>Index: {objectData.index}</p>
            <p>Basis Inclusion: {objectData.basis_inclusion}</p>
            <p>Date Categorization: {objectData.date_categorization}</p>
            <p>Category: {objectData.category}</p>
            <p>Basis Changes: {objectData.basis_changes}</p>
            <p>Date Changes: {objectData.date_changes}</p>
            <p>Date Changes Category: {objectData.date_changes_category}</p>
            <p>Category Changes: {objectData.category_changes}</p>
            <p>Basis Removal: {objectData.basis_removal}</p>
            <p>Date Removal: {objectData.date_removal}</p>
          </div>
        </Card.Text>   
      </Card.Body>
    </Card>
  );
};

export default CardObject;
